//? Elementos del html
const tabla = document.getElementById("data");
const abrirModal = document.getElementById('btnAgregar');
const modal = document.getElementById('modal');
const formulario = document.getElementById('formulario');
const inputFileImage = document.getElementById('fileImage');
const img = document.getElementById('imgBebida');
const cmbCategoria = document.getElementById('cmbCategoria');
const txtNombre = document.getElementById('txtNombre');
const txtPrecio = document.getElementById('txtPrecio');
const txtDescripcion = document.getElementById('txtDescripcion');
const btnLimpiar = document.getElementById('btnLimpiar');
const btnGuardar = document.getElementById('btnGuardar');

//? Variables o constantes que uso
let data = [];
let idBebida = 0;

//? Eventos
abrirModal.addEventListener('click', (event) => {
  limpiar();
  activar();
  mostrarModal();
});

document.getElementById('cerrarModal').addEventListener('click',(event)=>{
  event.preventDefault();
  cerrarModal();
});

btnLimpiar.addEventListener('click',(event)=>{
  event.preventDefault();
  limpiar();
})

inputFileImage.addEventListener('change',(event)=>{
  const imagen = inputFileImage.files[0];
  const reader = new FileReader();
  reader.onload = () => {
    const base64 = reader.result;
    img.src = base64;
  };
  reader.readAsDataURL(imagen);
});

btnGuardar.addEventListener('click',(event)=>{
  event.preventDefault();
  guardar();
});

//? Funciones
const cargaDatos= async () => {
    const mydata = await fetch('./Bebidas.json');
    let newData = await mydata.json();
    data = newData;
    imprimirDatos();
}

const imprimirDatos = ()=>{
  let html="";
    data.forEach(element => {
        if(element.status == 1) {
          html+=`<tr class="cuerpo">
                  <td>${element.nombre}</td>
                  <td>${element.descripcion}</td>
                  <td>${element.categoria}</td>
                  <td>
                    <button onclick="ver(${element.id})" class="boton-icono"><img src="data:image/png;base64," /></button>
                    <button onclick="editar(${element.id})" class="boton-icono"><img src="data:image/png;base64," /></button>
                    <button onclick="eliminar(${element.id})" class="boton-icono"><img src="data:image/png;base64," /></button>
                  </td>
                </tr>`;
        }
    });
    tabla.innerHTML =html;
};

const limpiar = ()=>{
  idBebida=0;
  txtNombre.value = "";
  txtPrecio.value = null;
  txtDescripcion.value="";
  cmbCategoria.value = "";
  inputFileImage.value="";
  img.src ="data:image/jpeg;base64,";
};

const guardar = ()=>{
  if (idBebida == 0) crearNuevo(); 
  else actualizar();
  //guardarData();
  cerrarModal();
  imprimirDatos();
  limpiar();
};

const cerrarModal = ()=>{
  modal.style.display = 'none';
}

const crearNuevo = () => {
  let newId = data[data.length-1].id + 1;
  const newRegister = {
    "id": newId,
    "nombre": txtNombre.value,
    "precio": parseFloat(txtPrecio.value),
    "categoria": cmbCategoria.value,
    "descripcion": txtDescripcion.value,
    "imagen": img.src,
    "status":1
  };
  data.push(newRegister);
};

const actualizar = () => {

  const newData = {
    "nombre": txtNombre.value,
    "precio": parseFloat(txtPrecio.value),
    "categoria": cmbCategoria.value,
    "descripcion": txtDescripcion.value,
    "imagen": img.src
  };

  const {idRegister, status} = data[idBebida-1];
  data[idBebida-1] = newData;
  data[idBebida-1].id = idRegister;
  data[idBebida-1].status = status;
};

const activar = () => {
  txtNombre.disabled = false;
  txtPrecio.disabled = false;
  cmbCategoria.disabled = false;
  txtDescripcion.disabled = false;
  inputFileImage.classList.remove('invisible');
};

const desactivar = () => {
  txtNombre.disabled = true;
  txtPrecio.disabled = true;
  cmbCategoria.disabled = true;
  txtDescripcion.disabled = true;
  inputFileImage.classList.add('invisible');
};

const eliminar = (idRegister) => {
  data[idRegister-1].status = 2;
  //guardarData();
  imprimirDatos();
};

//? No sirve
const guardarData = () => {
  const json = JSON.stringify(data);
  const fileWriter = new FileWriter('./Bebidas.json');
  fileWriter.write(json);
};

const ver = (idRegister) => {
  idBebida = idRegister;
  txtNombre.value = data[idBebida-1].nombre;
  txtPrecio.value = data[idBebida-1].precio;
  cmbCategoria.value = data[idBebida-1].categoria;
  txtDescripcion.value = data[idBebida-1].descripcion;
  img.src = data[idBebida-1].imagen;
  mostrarModal();
  btnGuardar.classList.add('invisible');
  btnLimpiar.classList.add('invisible');
  desactivar();
};

const editar = (idRegister) =>{
  activar();
  idBebida = idRegister;
  console.log(data[idBebida-1]);
  txtNombre.value = data[idBebida-1].nombre;
  txtPrecio.value = data[idBebida-1].precio;
  cmbCategoria.value = data[idBebida-1].categoria;
  txtDescripcion.value = data[idBebida-1].descripcion;
  img.src = data[idBebida-1].imagen;
  mostrarModal();
  btnLimpiar.classList.add('invisible');
};

const mostrarModal= () => {
  modal.style.display = 'block';
  btnGuardar.classList.remove('invisible');
  btnLimpiar.classList.remove('invisible');
};

//? Evento de carga
cargaDatos();